import React from "react"
import ToDoItem from "./components/ToDoItem"

import todoDatas from "./components/todosData"

function App() {

                const todoData = todoDatas.map( todo => {
                        return (
                            <ToDoItem key={todo.id} item={todo}/>
                        )
                })

            return(
                <div className="todo-list">
                        {todoData}
                </div>
            )
}



export default App
